@test integrate(x^3*(a+b*arcsec(c+d*x^4)), x) == :(1//4*a*x^4+-1//4*b*d^-1*arctanh((1+-1*(c+d*x^4)^-2)^(1/2))+1//4*b*d^-1*(c+d*x^4)*arcsec(c+d*x^4))
@test integrate(x^(-1+n)*arcsec(a+b*x^n), x) == :(-1*b^-1*n^-1*arctanh((1+-1*(a+b*x^n)^-2)^(1/2))+b^-1*n^-1*(a+b*x^n)*arcsec(a+b*x^n))
@test integrate(arcsec(c*exp(a+b*x)), x) == :((1/2)*im*b^-1*arcsec(c*exp(a+b*x))^2+(1/2)*im*b^-1*Polylogarithms.polylog(2,-1*exp(2*im*arcsec(c*exp(a+b*x))))+-1*b^-1*arcsec(c*exp(a+b*x))*log(1+exp(2*im*arcsec(c*exp(a+b*x)))))
@test integrate(x^-2*exp(arcsec(a*x)), x) == :(-1//2*x^-1*exp(arcsec(a*x))+(1/2)*a*(1+-1*a^-2*x^-2)^(1/2)*exp(arcsec(a*x)))
@test integrate(x^-3*exp(arcsec(a*x)), x) == :(-1//5*a^2*cos(2*arcsec(a*x))*exp(arcsec(a*x))+1//10*a^2*exp(arcsec(a*x))*sin(2*arcsec(a*x)))
@test integrate(x^-4*exp(arcsec(a*x)), x) == :(-3//40*a^3*cos(3*arcsec(a*x))*exp(arcsec(a*x))+-1//8*a^2*x^-1*exp(arcsec(a*x))+1//8*a^3*(1+-1*a^-2*x^-2)^(1/2)*exp(arcsec(a*x))+1//40*a^3*exp(arcsec(a*x))*sin(3*arcsec(a*x)))
@test integrate((d*x+a*d*b^-1)^-1*arcsec(a+b*x), x) == :((1/2)*im*d^-1*arcsec(a+b*x)^2+(1/2)*im*d^-1*Polylogarithms.polylog(2,-1*exp(2*im*arcsec(a+b*x)))+-1*d^-1*arcsec(a+b*x)*log(1+exp(2*im*arcsec(a+b*x))))
